import React from 'react';
import { Image, StyleSheet, Text, TouchableOpacity, View } from 'react-native';


export default function Footer() {
  return (
    <View style={styles.container}>

      <Text style={styles.instructions}> 
        fuck off
        </Text>

      <TouchableOpacity onPress = {() => alert('I fuck you now')}
      style = {styles.button}>
        <Text style= {styles.buttonText}>Start Game</Text>
      </TouchableOpacity>

    </View>
    
  );
}

const styles = StyleSheet.create({
  logo:{
    width: 305, 
    height: 159,
    marginBottom: 0,
  },
  instructions:{
    color: '#888', 
    fontSize: 18,
    marginHorizontal: 15,
  },
  container: {
    flex: 1,
    backgroundColor: '#fff73',
    alignItems: 'center',
    justifyContent: 'center',
  },
  button: {
    backgroundColor: "blue",
    padding: 20,
    borderRadius: 5,
  },
  buttonText: {
    fontSize: 20,
    color: '#fff',
  }
});
